export const chargeBasic = () => {
    return {
      type: "CHARGE_BASIC"
    };
};

export const chargePremium = () => {
    return {
      type: "CHARGE_PREMIUM"
    };
};

export const addDiscount = discountInput => {
  return {
    type: "DISCOUNT_ADDED",
    payload: discountInput
  };
};

export const addItemPremium = () => {
  return {
    type: "ADD_ITEM_PREMIUM"
  };
};

export const addItemBasic = () => {
  return {
    type: "ADD_ITEM_BASIC"
  };
};

